void mainImage(out vec4 O, vec2 C) {
    O=vec4(0);
	for(float g=0.,e,j,i=0.;i++<50.;){
   		vec3 p=g*vec3((C*2.-iResolution.xy)/iResolution.y,1),q;
        p.z+=iTime;
        q=p;
        p=fract(p)-.5;
        for(j=6.;--j>0.;)
			p.xy=abs(p.xy)-.08*j,
            p.xy=vec2((p.x+p.y)*.6,(p.x-p.y)*.4)*j,
            p.xy*=.6;
        g+=e=.6*length(p.yz)-2e-3;
        e<.01?O.xyz+=abs(sin(q*35.))*.6/i:p;
    }
}
